import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { ButtonClickService } from '../../services/button-click.service'; // Import yolunu kontrol edin
import { HttpErrorResponse } from '@angular/common/http';

@Component({
  selector: 'app-page5',
  templateUrl: './page5.component.html',
  styleUrls: ['./page5.component.css']
})
export class Page5Component {
  userId: string = '';
  buttonClicks: any[] | null = null;

  constructor(private buttonClickService: ButtonClickService, private router: Router) {}

  fetchButtonClicks() {
    this.buttonClickService.getButtonClicks(this.userId).subscribe(
      (response: any) => {
        this.buttonClicks = response;
      },
      (error: HttpErrorResponse) => {
        console.error('Error fetching button clicks:', error);
      }
    );
  }

  handleButtonClick(page: string) {
    if (page === 'Logout_Button') {
      this.router.navigate(['/login']); // Çıkış yapma yönlendirmesi
    } else {
      this.router.navigate([`/${page}`]); // Diğer sayfalara yönlendirme
    }
  }
}
